export default function Feadback({ good, neutral, bad, total, rate }) {
  return (
    <div>
      <p>Good :{good}</p>
      <p>Neutral : {neutral}</p>
      <p>Bad :{bad}</p>
      <p>Total :{total}</p>
      <p>Positive feadback:{rate}</p>
    </div>
  );
}
